void loadTextures() {
	// load textures from the textures.h
	
    loadWallTextures();
    
    
    textures[0] = (uint32_t*)REDBRICK_TEXTURE;
    textures[1] = (uint32_t*)PURPLESTONE_TEXTURE;
    textures[2] = (uint32_t*)MOSSYSTONE_TEXTURE;
    textures[3] = (uint32_t*)GRAYSTONE_TEXTURE;
    textures[4] = (uint32_t*)COLORSTONE_TEXTURE;
    textures[5] = (uint32_t*)BLUESTONE_TEXTURE;
    textures[6] = (uint32_t*)WOOD_TEXTURE;
    textures[7] = (uint32_t*)EAGLE_TEXTURE;
    



    // allocate the amount of bytes in memory to hold texturebuffer
    textures[0] = (uint32_t*)malloc(sizeof(uint32_t) * (uint32_t)TEXTURE_WIDTH * (uint32_t)TEXTURE_HEIGHT);
    // create texture with pattern
    for (int x = 0; x < TEXTURE_WIDTH; x++) {
        for (int y = 0; y < TEXTURE_HEIGHT; y++) {
            textures[0][(TEXTURE_WIDTH * y) + x] = (x % 8 && y % 8) ? 0xFF226655 : 0xFF003355;
        }
    }

}



void generateWallProjection(void) {
	for (int x = 0; x < NUM_RAYS; x++) {
		float perpDistance = rays[x].distance * cos(rays[x].rayAngle - player.rotationAngle);
		float projectedWallHeight = (TILE_SIZE / perpDistance) * DIST_PROJ_PLANE;

		int wallStripHeight = (int)projectedWallHeight;

		int wallTopPixel = (WINDOW_HEIGHT / 2) - (wallStripHeight / 2);
		wallTopPixel = wallTopPixel < 0 ? 0 : wallTopPixel;

		int wallBottomPixel = (WINDOW_HEIGHT / 2) + (wallStripHeight / 2);
		wallBottomPixel = wallBottomPixel > WINDOW_HEIGHT ? WINDOW_HEIGHT : wallBottomPixel;

		// ceiling
		for (int y = 0; y < wallTopPixel; y++) {
			drawPixel(x, y, 0xFF000000);
		}

		// wall
		int textureOffsetX;
		if (rays[x].wasHitVertical) {
			// choose vertical
			textureOffsetX = (int)rays[x].wallHitY % TILE_SIZE;
		}
		else {
			// choose horizontal
			textureOffsetX = (int)rays[x].wallHitX % TILE_SIZE;
		}

		// -1 fordi 0 er ingen vg
		int texNum = rays[x].wallHitContent - 1;

		for (int y = wallTopPixel; y < wallBottomPixel; y++) {
			// offset of streach
			// distancefromtop for at undg at der begrnses top og bund
			int distanceFromTop = (y + wallStripHeight / 2) - WINDOW_HEIGHT / 2;
			int textureOffsetY = (distanceFromTop * ((float)TEXTURE_HEIGHT / wallStripHeight));
			// set the color based on the texture
            //uint32_t texelColor = wallTextures[texNum].texture_buffer[(TEXTURE_WIDTH * textureOffsetY) + textureOffsetX];
            uint32_t texelColor = textures[texNum][(TEXTURE_WIDTH * textureOffsetY) + textureOffsetX];
			
            if (rays[x].wasHitVertical) {
				changeColorIntensity(&texelColor, 0.55);
			}
            // mske skal denne ndres
			drawPixel(x, y, texelColor);
		}
		// floor
		for (int y = wallBottomPixel; y < WINDOW_HEIGHT; y++) {
			drawPixel(x, y, 0xFF555555);
		}
	}
}
